import React from 'react';

const Spacing = () => {
  const spacingClasses = [
    {
      margin: {
        id: 1,
        classTitle: 'mAuto',
        description: 'margin: 0 auto;',
      },
    },
    {
      padding: {
        id: 1,
        classTitle: 'mAuto',
        description: 'margin: 0 auto;',
      },
    },


    {
      id: 2,
      classTitle: 'p0',
      description: 'padding: 0;',
    },
    {
      id: 3,
      classTitle: 'p1',
      description: 'padding: 0;',
    },
    {
      id: 4,
      classTitle: 'p2',
      description: 'padding: 0;',
    },
    {
      id: 5,
      classTitle: 'p3',
      description: 'padding: 0;',
    },
    {
      id: 6,
      classTitle: 'p4',
      description: 'padding: 0;',
    },
    {
      id: 7,
      classTitle: 'p5',
      description: 'padding: 0;',
    },
    {
      id: 8,
      classTitle: 'p6',
      description: 'padding: 0;',
    },
  ];
  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='sectionTitle pb2'>
          <h5 className='fontStyled fsH5 primary'>Spacing</h5>
        </div>

        <div className='row pb1 fontStyled primary'>
          <div className='col12 classTitle'>
            <h6 className='fsSM'>Classes Names</h6>
          </div>
        </div>

        {spacingClasses.map((sp) => (
          <>
            <div className='row alignCenter mb1'>
              <div className='col4 col3-sm'>
                <p className='fsSM fwBold'>.{sp.classTitle}:</p>
              </div>
              <div className='col2'>
                <div className={`border bgPrimary textCenter ${sp.classTitle}`}>
                  <div className='bgLight'>{sp.classTitle}</div>
                </div>
              </div>
            </div>
          </>
        ))}
      </div>
    </>
  );
};

export default Spacing;
